import axios from 'axios';

export function createPNUser(data) {
    console.log(data,"data in createUser")
    axios.post('https://notifier-staging.tokopedia.com/imt/api/v1/user/add',{headers:{
        'X-GA-ID':'232377',
    },data})
        .then(function (response) {
            console.log('response is abc' ,response)
        })
        .catch(function (error) {
            console.log('not enter in sucess function ' , error)
        });
}


import * as types from '@/constants/Types';
import Api from '@/utils/Api';
import Store from '@/reducer';
import store from '@/reducer/index';

export const fetchUserRequest = () => {
    Store.dispatch({
        type: types.FETCH_USER_REQUEST,
    });
    Api.getUser()
        .then(res => {
            console.log(res,"response is here")
        })
        .catch(err => {
        });
};
